cy.request({
  method: 'POST',
  url: `${apiBase}/transfer?fromAccountId=${fromAccountId}&toAccountId=${toAccountId}&amount=${amount}`,
  failOnStatusCode: false,
  // Prevent Cypress from failing the test on non-2xx status codes
  headers: {
    accept: 'application/json'
  }
}).then(response => {
  //400 Bad Request (fromAccountId Ã©s toAccountId are same) or 422 Unprocessable Entity(the data is invalid)
  expect(response.status).to.be.oneOf([400, 422]);
  expect(response.body).to.contain('Could not find account number ' + fromAccountId + ' and/or ' + toAccountId);
});

cy.request({
  method: 'POST',
  url: `${apiBase}/requestLoan?customerId=${customerId}&amount=${amount}&downPayment=${downPayment}&fromAccountId=${fomAccountId}`,
  failOnStatusCode: false,
  headers: {
    accept: 'application/json'
  }
}).then(response => {
  expect(response.status).to.eq(200);
  cy.log(JSON.stringify(response.body));
  expect(response.body).to.have.property('responseDate');
  expect(response.body).to.have.property('loanProviderName');
  expect(response.body).to.have.property('approved', true);
  if (response.body.message) {
    expect(response.body.message).to.be.a('string');
  } else {
    cy.log('Message property is not returned in this response');
  }
  expect(response.body).to.have.property('accountId').that.is.a('number');
});

